import React from "react";
import { CircularProgressbar } from "react-circular-progressbar";

const Skills = () => {
  const html = 66;

  return (
    <div className="skills container-fluid">
      <div className="col-md-6 container techniclal">
        <div className="row">
          <h3>Technical skills</h3>
          <CircularProgressbar 
          value={html} 
          text="html" />
        </div>
      </div>
      <div className="col-md-6 container soft">
        <div className="row">
          <h3>soft skills</h3>
        </div>
      </div>
    </div>
  );
};
export default Skills;
